const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<MainPage />} />
        {/* Ensure the path includes all necessary parameters */}
        <Route path="/seatselection/:flightID/:from/:to" element={<SeatSelection />} />
        {/* Include flightID and selectedSeat parameters in the path */}
        <Route path="/confirmationscreen/:flightID/:selectedSeat" element={<ConfirmationScreen />} />
        {/* Add other routes as needed */}

      </Routes>
    </BrowserRouter>
  );
};

export default App;
